// SPDX-License-Identifier: MIT
pragma solidity ^0.8.7;

contract Storage {
    uint256 number;

    function store(uint256 num) public {
        number = num;
    }

    function retrieve() public view returns (uint256){
        return number;
    }

    function inspectSender() public view returns(address) {
        return msg.sender;
    }

    function inspectOrigin() public view returns(address) {
        return tx.origin;
    }
}

contract Caller {
    Storage public StorageObject;

    constructor(address storageAddress) {
        StorageObject = Storage(storageAddress);
    }

    function inspectInspectSender() public view returns(address) {
        return StorageObject.inspectSender();
    }

    function inspectSender() public view returns(address) {
        return msg.sender;
    }

    function inspectInspectOrigin() public view returns(address) {
        return StorageObject.inspectOrigin();
    }

    function inspectOrigin() public view returns(address) {
        return tx.origin;
    }
}

